def DFT(timeDomainSamples,frequencyDomainSamples):

    frequencyDomainSamples.clear();
    point = len(timeDomainSamples);

    DFTmatrix = None;
    if point == 64:
        DFTmatrix = DFTmatrix64;
    if point == 128:
        DFTmatrix = DFTmatrix128;
    if point == 256:
        DFTmatrix = DFTmatrix256;


    if DFTmatrix != None:
        for i in range(point):
            temp = 0;
